import React, { useState } from "react";
import axios from "axios";

const AddMemberModal = ({ show, onClose }) => {
  const [formData, setFormData] = useState({
    registrationType: "",
    memberType: "",
    registrationDate: "",
    shareCapital: "",
    fullNameLastName: "",
    fullNameFirstName: "",
    fullNameMiddleName: "",
    maidenName: "",
    tinNumber: "",
    dateOfBirth: "",
    birthplaceProvince: "",
    age: "",
    sex: "",
    civilStatus: "",
    highestEducationalAttainment: "",
    occupationSourceOfIncome: "",
    spouseName: "",
    spouseOccupationSourceOfIncome: "",
    primaryBeneficiaryName: "",
    primaryBeneficiaryRelationship: "",
    primaryBeneficiaryContact: "",
    secondaryBeneficiaryName: "",
    secondaryBeneficiaryRelationship: "",
    secondaryBeneficiaryContact: "",
    contactNumber: "",
    houseNoStreet: "",
    barangay: "",
    city: "",
    referenceName: "",
    position: "",
    referenceContact: "",
    email: "",
    password: "",
    idPicture: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, idPicture: e.target.files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    Object.keys(formData).forEach((key) => {
      data.append(key, formData[key]);
    });

    try {
      const response = await axios.post("/api/addMember", data, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      alert(response.data.message);
      onClose();
    } catch (error) {
      console.error("Error adding member:", error.response?.data?.message || error.message);
      alert("Error adding member. Please try again.");
    }
  };

  return (
    <div className={`modal ${show ? "d-block" : "d-none"}`} tabIndex="-1">
      <div className="modal-dialog modal-lg">
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">Add Member</h5>
            <button type="button" className="btn-close" onClick={onClose}></button>
          </div>
          <div className="modal-body">
            <form onSubmit={handleSubmit}>
              <div className="row">
                <div className="col-md-6">
                  <label>Registration Type</label>
                  <input
                    type="text"
                    name="registrationType"
                    className="form-control"
                    value={formData.registrationType}
                    onChange={handleChange}
                  />
                </div>
                <div className="col-md-6">
                  <label>Member Type</label>
                  <input
                    type="text"
                    name="memberType"
                    className="form-control"
                    value={formData.memberType}
                    onChange={handleChange}
                  />
                </div>
              </div>
              {/* Add other form fields in a similar structure */}
              <div className="mb-3">
                <label>ID Picture</label>
                <input
                  type="file"
                  name="idPicture"
                  className="form-control"
                  onChange={handleFileChange}
                />
              </div>
              <button type="submit" className="btn btn-primary">
                Submit
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AddMemberModal;
